        public Dictionary<byte, NoisepediaEntry> GetNoisepediaDictionary()
        {
            return Noisepedia;
        }

        public NoisepediaEntry GetNoisepediaEntry(byte NoiseId)
        {
            if (Noisepedia.ContainsKey(NoiseId))
            {
                return Noisepedia[NoiseId];
            }

            return null;
        }

        public NoisepediaEntry GetNoisepediaEntryWithNoiseId(uint NoiseId)
        {
            foreach (NoisepediaEntry Entry in Noisepedia.Values)
            {
                if (Entry.NoiseId == NoiseId)
                {
                    return Entry;
                }
            }

            return null;
        }

        public Noise GetNoiseWithNoisepediaId(byte NoisepediaId)
        {
            NoisepediaEntry Entry = GetNoisepediaEntry(NoisepediaId);

            if (Entry != null)
            {
                return GetNoiseWithNoisepediaEntry(Entry);
            }

            return null;
        }

        public Noise GetNoiseWithNoisepediaEntry(NoisepediaEntry Entry)
        {
            if (Entry == null)
            {
                return null;
            }

            if (NoiseData.ContainsKey(Entry.NoiseId))
            {
                return NoiseData[Entry.NoiseId];
            }

            return null;
        }
